# Ispik, Republic of Dagestan

}}
Ispik () is a rural locality (a selo) and the administrative centre of Ispiksky Selsoviet, Suleyman-Stalsky District, Republic of Dagestan, Russia. Population:  There are 7 streets.
Geography
Ispik is located  southeast of Makhachkala and  southeast of Kasumkent (the district's administrative centre) by road. Butkent is the nearest rural locality.
